import './App.css';
import Navbar from './Components/Navbar';
import Userlog from './Components/Users/Userlog';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {

  return (
    <>
      <Navbar/>
      <br></br>
      <br></br>
      <br></br>
      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      <Userlog/>
    </>
  );
}

export default App;
